import React from 'react';
import './Header.css';
import logoLabenu from 'C:\Users\rafae\OneDrive\education\labenu\aulas\git\jemison-Rafael-Lopes\modulo-3\styled-components\ex-styled-components\src\components\Logo/logoLabenujpg.jpg'


 const Header = () => (
    <div className="header">
        <img src={logoLabenu} alt="Logo da Labenu" />
    </div>
)

export default Header;
